import styled from "styled-components";
import Background from "../image/Background.webp";

const About = () => {
  return (
    <AboutWrap>
      <div className="content">
        <p>STUDIO CYLO</p>
        <h3>Stay hungry</h3>
        <h3>Stay foolish</h3>
      </div>
    </AboutWrap>
  );
};

const AboutWrap = styled.section`
  width: 100%;
  min-height: 100vh;
  background-color: #000;
  padding: 10rem 24px 0;
  .content {
    position: relative;
  }
`;
export default About;
